import React from "react";

function Review() {
  return (
    <div className="flex p-5 gap-10">
      <div className="w-1/2 flex flex-col gap-10 bg-black rounded-md">
        <div className="code"></div>
        <div className="review-btn"></div>
      </div>
      <div className="w-1/2 flex flex-col gap-10 bg-[#343434] rounded-md"></div>
    </div>
  );
}

export default Review;
